import './App.css';
import { Routes, Route } from 'react-router-dom';
import TotalSalesTable from './components/TotalSalesTable';

function App() {
  return (
    <Routes>
      <Route path="/sales/:vendorId" element={<TotalSalesTable />} />
    </Routes>
  );
}

export default App;
